import React, { lazy } from "react";
import "./AppContent.css";

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

// import ErrorView from "../AppContent/Error404/Error404";
// import HomeView from "../AppContent/HomeView/HomeView";
const HomeView = lazy(() => import("../AppContent/HomeView/HomeView"));
// import ShopView from "../AppContent/ShopView/ShopView";
// import LoginView from "../AppContent/Forms/LoginView/LoginView";
const LoginView = lazy(() => import("../AppContent/Forms/LoginView/LoginView"));

// import RegisterView from "../AppContent/Forms/RegisterView/RegisterView";
const RegisterView = lazy(() => import("../AppContent/Forms/RegisterView/RegisterView"));

const AppContent = function () {
    return (
        <main>
            <Switch>
                <Route path="/register" component={RegisterView} exact />
                <Route path="/login" component={LoginView} exact />
                <Route path="/" component={HomeView} exact />
            </Switch>
        </main>
    );
}

export default AppContent;
